Уважаемые пользователи, Здравствуйте: 
 Чтобы лучше обслуживать пользователей и предоставлять более профессиональные контрактные услуги, скоро будет запущена новая веб-версия и версия приложения бессрочного контракта.
 1. Перед официальным переходом мы предоставляем вам систему контрактов с двумя версиями. В то же время, когда новый контракт только запускается, несовершенств может быть много. Если вы обнаружите ошибку или какое-либо предложение, отправьте его по ссылке: 
 2. В это время прекратится доступ к старой системе контрактов. Пользователи старого контракта должны вовремя закрыть свои позиции и перевести свои активы на валютный счет до соответствующего времени; если они не будут закрыты и переведены вовремя, платформа будет основана на рыночной цене в то время. Автоматическая ликвидация и расчет, а также перевод активов на валютные счета; невыполненные заказы будут автоматически отменены системой.
 3. Вы можете свободно переключаться между старыми и новыми контрактами через верхний плавающий слой навигации. После того, как вы нажмете [Переключить новую/старую версию], вы одновременно переключитесь при доступе к транзакциям по контракту, активам по контракту, заказам по контракту и операционным функциям, связанным с контрактом; обратите внимание, что старая и новая версии данных контракта несовместимы;\ n Затронутые функции включают, но не ограничиваются: контрактный брокер, плата за опыт контракта, документальный контракт контракта, конкурс контракта;
 4. Ваши контрактные активы должны быть переведены на валютный счет перед переводом на контрактный счет;

Посредством ежедневной корректировки позиций система обеспечивает увеличение прибыли и сокращение убытков по контрактным левереджам на нижних уровнях ETF. Это гарантирует, что коэффициент кредитного плеча ETF пользователя соответствует согласованному коэффициенту.
ETF делится на два вида: временная коррекция позиции. и нет временной корекцыи позиции, в которой временная корекцыя позиции относится к тому, что платформа будет ежедневно в фиксированный момент времени выполнять управление перебалансировкой позиций, используемое для обеспечения того, чтобы ETF находились в согласованном множественном кредитном плече в начале дня;
Регулировка положения без времени, относится к временной корекцыя позиции. Когда фактическое кредитное плечо, кратное ETF, превышает определенный уровень в течение дня, а позиция является согласованным кратным кредитным плечом после корректировки позиции.
